package exercicios;

public class Exercicio1Repeticao {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Declarar variavel
		
		int cont = 15; // inicializador
		double quadrado  ;
		
		//Processamento
		
		while (cont<=200) {
			
			quadrado = Math.pow(cont, 2);
			System.out.println(quadrado);//Saida
			cont ++; // incremento
			//cont =cont+1
			//cont +=1;
		} //Fim do While
			
	}
		
			
}


